import CssGameMainView from "@/components/Dashboard/GameComponents/CssMission/CssGameMainView.vue";
import CssLvl1 from "@/components/Dashboard/GameComponents/CssMission/CssLvl1.vue";
import CssLvl2 from "@/components/Dashboard/GameComponents/CssMission/CssLvl2.vue";
export default[
    {
        path:'/css-game',
        component:CssGameMainView
    },
    {
        path:'/css-game/lvl-1',
        component:CssLvl1,
    },
    {
        path:'/css-game/lvl-2',
        component:CssLvl2
    }
]
